import React, { useState } from 'react';
import Login from './auth/Login';
import Signup from './auth/Signup';
import SocialLogin from './auth/SocialLogin';

const HomePage = () => {
  const [userList, setUserList] = useState([]);

  return (
    <main>
      <section id="home">
        <h2>Welcome to My Simple Homepage</h2>
        <p>This is a simple React homepage example.</p>
      </section>
      <section id="about">
        <h2>About</h2>
        <p>This section contains information about the homepage.</p>
      </section>
      <section id="contact">
        <h2>Contact</h2>
        <p>This section contains contact information.</p>
      </section>
      <Login />
      <Signup userList={userList} setUserList={setUserList} />
      <SocialLogin />
    </main>
  );
};

export default HomePage;
